  incomesAndExpenses1,
  expenseLimits,
  10,
  'Going to cinema 🍿',
  'YouRa'
);
console.log(incomesAndExpenses2);

const incomesAndExpenses3 = addExpense(
  incomesAndExpenses2,
  expenseLimits,
  200,
  'Something',
  'John'
);
console.log(incomesAndExpenses3);

